    useEffect(()=>{
      async function fetchData () {
          const request = await instance.get(props.fetchURL);
          console.log(request);
      }

      fetchData()
    }, []);

    return (
        <div>
           <h3>{props.title}</h3> 
        </div>
    )
}

export default AllRows;
